import Link from 'next/link'

const Navbar = () => {
  return (
    <div className='navbar'>

    <h3 className='brand'>JVALLEY</h3>
    <ul>
        <li>
            <Link href="/">
                <a> HOME </a>
            </Link>
        </li>

        <li>
            <Link href="/about">
                <a> ABOUT </a>
            </Link>
        </li>

        <li>
            <Link href="/contact">
                <a> CONTACT </a>
            </Link>
        </li>

        <li>
            <Link href="/gallery">
                <a> GALLERY </a>
            </Link>
        </li>

    </ul>


  <style jsx>{`
    .navbar{
        width : 100%;
        height : 10vh;
        background-color : black;
        display : flex;
        padding : 0px 40px;
    }
    ul{
        display : flex;
        justify-content : center;

    }

    li a{
        height : 100%;
        margin : 20px;
        display:flex;
        justify-content : center;
        align-items : center;
        color : white;
        text-decoration : none;
        cursor : pointer;
    }

  `}</style>

    </div>
  )
}

export default Navbar
